import React from 'react'
import data from './data'
import './home.css'
export default function Homepage() {
  return (
    <>

  <div className="row row-cols-1 row-cols-md-3 g-4">
    <div className="card h-100" style={{width: "15rem",height: '20rem'}}>
    {
      data.map((data)=>{
        const{image}=data;
      return <img src={image}  alt="..." className="card-img-top"/>
      })
    }
    </div>
  </div>
    <div className="card" style={{width: "15rem",height: '20rem'}}>
      <div className="card-body">
    <h5 className="card-title">WHEN YOU SEE YOUR CRUSH LOOK AT YOU</h5>
      </div>
    </div> 
    </>
  )
  }
